import "./app.css";
import Header from "./pages/Header/header";
import About from "./pages/About/About";

import NavBar from "./components/navBar/navBar";

import Logo from "./img/logo.png";
import aboutImg from "./img/12.jpg";


function App() {
  return (
    <div className="App">
      <NavBar Logo={Logo}/>
      <Header/>
      <About aboutImg={aboutImg}/>
    </div>
  );
}

export default App;
